export default (props) => {
    const [login,setLogin] = useState({
        user: '',
        password: ''
      });
    const router = useRouter();

    // console.log(router.query.name)
    return <>
        <InternalLayout adminFlag='y'>
            <Profile />
            <CollapseAccodion />
        </InternalLayout>
    </>
}
